import React from 'react';
import styled from 'styled-components';
import { 
  BsSearch, 
  BsBarChart, 
  BsGear, 
  BsFileText,
  BsFilter,
  BsSave,
  BsTrash 
} from 'react-icons/bs';

const IconContainer = styled.span`
  display: inline-flex;
  align-items: center;
  justify-content: center;
  font-size: 1.2rem;
`;

export const SearchIcon = () => (
  <IconContainer>
    <BsSearch />
  </IconContainer>
);

export const ChartIcon = () => (
  <IconContainer>
    <BsBarChart />
  </IconContainer>
);

export const GearIcon = () => (
  <IconContainer>
    <BsGear />
  </IconContainer>
);

export const FileIcon = () => (
  <IconContainer>
    <BsFileText />
  </IconContainer>
);

export const FilterIcon = () => (
  <IconContainer>
    <BsFilter />
  </IconContainer>
);

export const SaveIcon = () => (
  <IconContainer>
    <BsSave />
  </IconContainer>
);

export const TrashIcon = () => (
  <IconContainer>
    <BsTrash />
  </IconContainer>
);
